import React, {useContext} from 'react'
import styled from 'styled-components'
import {HiOutlineUserCircle} from 'react-icons/hi'
import {AiOutlineWhatsApp} from 'react-icons/ai'
import {HiOutlineMenu} from 'react-icons/hi'
import {Context} from '../Context'
const Navbarall = styled.div`
width : 100%;
height : 60px;
display : flex;
align-items : center;
justify-content : space-around;
border-bottom : solid 2px lightgreen;
@media (max-width: 768px) {
  justify-content : space-between;
  }
`


const Imgdiv = styled.div`
width  : 10%;
height : 60px;
@media (max-width: 768px) {
  margin-left : 20px
  }
`
const Userinfo = styled.div`
width : 20%;
height : 60px;
display : flex;
align-items : center;
justify-content : space-around;
@media (max-width: 768px) {
    display : none
  }
`



const Toggle = styled.div`
width : 20%;
height : 60px;
margin-right  :10px;
display : none;
@media (max-width: 768px) {
    display : block
  }
`

const Username = styled.p`
color : white;
padding-left : 100px;
padding-top : 10px
`


const Userlogo = styled.div`
width : 20%;
height : 60px;

`



function Navbar() {

 const {username} = useContext()

  return (
    <div>
    <Navbarall>

    <Imgdiv>
    <AiOutlineWhatsApp style = {{color : "white",fontSize : "40px",marginTop : "5px"}}/>
    </Imgdiv>

    <Userinfo>
    <Username>Ellez</Username>
    <Userlogo><HiOutlineUserCircle style = {{color : "white",fontSize : "40px",marginTop : "5px"}}/></Userlogo>    
    </Userinfo>

    <Toggle>
    <HiOutlineMenu style = {{color : "white",fontSize : "40px",marginTop : "5px"}}></HiOutlineMenu>
    </Toggle>



    </Navbarall>
    </div>
  )
}

export default Navbar
